import React from 'react';
import style from './OutlineButton.module.scss';
const OutlineButton = (props) => {

	return (
		<button className={style.btn}> <span className={style.btnAnimateTop}></span>  <span className={style.btnText}> {props.name}</span>
		  </button>
	);
}
export default OutlineButton;
